[{"location":"","page":"Home","title":"Home","text":"CurrentModule = SASLMR","category":"page"},{"location":"#SASLMR","page":"Home","title":"SASLMR","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for SASLMR.","category":"page"},{"location":"","page":"Home","title":"Home","text":"This program comes with absolutely no warranty. No liability is accepted for any loss and risk to public health resulting from use of this software.","category":"page"},{"location":"","page":"Home","title":"Home","text":"SASLMR.jl is Julia package, it wrapp sasLM package for R project for ANOVA type I/II/III.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Exported functions: aov1, aov2, aov3, aov, ciest, rantest","category":"page"},{"location":"","page":"Home","title":"Home","text":"Install:","category":"page"},{"location":"","page":"Home","title":"Home","text":"import Pkg; Pkg.add(url=\"https://github.com/PharmCat/SASLMR.jl.git\")","category":"page"},{"location":"","page":"Home","title":"Home","text":"Note:","category":"page"},{"location":"","page":"Home","title":"Home","text":"SASLMR.jl doesn't install sasLM. To use SASLMR.jl first install sasLM in your R project enviroment.  Check that R project is included in PATH, and check that RCall.jl builded successfully.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Using:","category":"page"},{"location":"","page":"Home","title":"Home","text":"using SASLMR\nusing StatsModels, StatsBase, DataFrames\n\n# data (DataFrame)\nbedf = SASLMR.bedata()\n\n# run ANOVA\nbeaov = SASLMR.aov(@formula(CMAX ~  PRD + TRT + SEQ + SUBJ&SEQ), bedf; beta=true, resid=true, type = \"III\")\n\n# get DF\nbeaovdf = DataFrame(beaov.ct)\n\n# or get coeftable\n\nct = coeftable(beaov)","category":"page"},{"location":"","page":"Home","title":"Home","text":"For more details see: ","category":"page"},{"location":"","page":"Home","title":"Home","text":"https://cran.r-project.org/web/packages/sasLM/sasLM.pdf","category":"page"},{"location":"","page":"Home","title":"Home","text":"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7781810/","category":"page"},{"location":"","page":"Home","title":"Home","text":"SASLMR.jl not cover all sasLM functionality... so... wellcome any PR for extending.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [SASLMR]","category":"page"},{"location":"#SASLMR.aov-Tuple{Any, Any}","page":"Home","title":"SASLMR.aov","text":"aov(f, d; beta=true, resid=true, type = \"III\")\n\nSame as aov1, aov2, aov3.\n\nKeyword type: ANOVA SS Type I/II/III (III by default).\n\n\n\n\n\n","category":"method"},{"location":"#SASLMR.aov1-Tuple{Any, Any}","page":"Home","title":"SASLMR.aov1","text":"aov1(f, d; beta=true, resid=true)\n\nFunction:\n\naov1(Formula, Data, BETA=FALSE, Resid=FALSE)\n\nANOVA with Type I SS.\n\nArguments:\n\nFormula a conventional formula for a linear model.\n\nData a data.frame to be analyzed\n\nBETA if TRUE, coefficients (parameters) of REG will be returned. This is equivalent to SOLUTION option of SAS PROC GLM\n\nResid if TRUE, fitted values (y hat) and residuals will be returned\n\nDetails\n\nIt performs the core function of SAS PROC GLM, and returns Type I SS. This accepts continuous independent variables also.\n\nValue\n\nThe result table is comparable to that of SAS PROC ANOVA.\n\nDf degree of freedom\n\nSum Sq sum of square for the set of contrasts\n\nMean Sq mean square\n\nF value F value for the F distribution\n\nPr(>F) proability of larger than F value\n\nNext returns are optional.\n\nParameter Parameter table with standard error, t value, p value. TRUE is 1, and FALSE is 0 in the Estimable column. This is returned only with BETA=TRUE option.\n\nFitted Fitted value or y hat. This is returned only with Resid=TRUE option.\n\nResidual Weigthed residuals. This is returned only with Resid=TRUE option.\n\n\n\n\n\n","category":"method"},{"location":"#SASLMR.aov2-Tuple{Any, Any}","page":"Home","title":"SASLMR.aov2","text":"aov2(f, d; beta=true, resid=true)\n\nFunction:\n\naov2(Formula, Data, BETA=FALSE, Resid=FALSE)\n\nANOVA with Type II SS.\n\nDescription see aov1.\n\n\n\n\n\n","category":"method"},{"location":"#SASLMR.aov3-Tuple{Any, Any}","page":"Home","title":"SASLMR.aov3","text":"aov3(f, d; beta=true, resid=true)\n\nFunction:\n\naov3(Formula, Data, BETA=FALSE, Resid=FALSE)\n\nANOVA with Type III SS.\n\nDescription see aov1.\n\n\n\n\n\n","category":"method"},{"location":"#SASLMR.bedata-Tuple{}","page":"Home","title":"SASLMR.bedata","text":"bedata()\n\nReturn BEdata (Contains Cmax data from a real bioequivalence study).\n\n\n\n\n\n","category":"method"},{"location":"#SASLMR.ciest-Tuple{Any, Any, AbstractString, AbstractVector}","page":"Home","title":"SASLMR.ciest","text":"ciest(f, d, term, contrast; level = 0.95, est = false)\n\nIf est == true - return estimate table.\n\nCIest(Formula, Data, Term, Contrast, conf.level=0.95)\n\nGet point estimate and its confidence interval with given contrast and alpha value using t distribution.\n\n\n\n\n\n","category":"method"},{"location":"#SASLMR.rantest-Tuple{Any, Any, Any}","page":"Home","title":"SASLMR.rantest","text":"rantest(f, d, random; type = \"III\", eps::Float64 = 1e-8)\n\nHypothesis test of with specified type SS using random effects as error terms. This corresponds to SAS PROC GLMâ€™s RANDOM /TEST clause\n\nSame as:\n\nRanTest(f, d, Random = \"\", Type=3, eps=1e-8)\n\nType can be from 1 to 3. All interaction terms with random factor are regarded as random effects. Here the error term should not be MSE\n\nReturns ANOVA and E(MS) tables with specified type SS.\n\n\n\n\n\n","category":"method"},{"location":"#StatsAPI.coeftable-Tuple{SASLMR.AOVSumm}","page":"Home","title":"StatsAPI.coeftable","text":"StatsBase.coeftable(obj::AOVSumm)\n\n\n\n\n\n","category":"method"}]
